import Navigationbar from './components/navigationbar';


function App() {
  return (
    <div className="App">
    <Router>
        <Navigationbar />
        <Switch>
            <Route exact path='/' component={Home}/>
            <Route path='/about' component={About}/>
            <Route path='/about' component={Contact}/>
        </Switch>
    </Router>
</div>
  );
}

export default App;
